@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

atm:CashCard a owl:Class .
atm:Bank a owl:Class .
atm:BankCode a owl:Class .

atm:issuedBy a owl:ObjectProperty ;
  rdfs:domain atm:CashCard ;
  rdfs:range atm:Bank .

atm:hasBankCode a owl:ObjectProperty ;
  rdfs:domain atm:Bank ;
  rdfs:range atm:BankCode .

atm:isValid a owl:DatatypeProperty ;
  rdfs:domain atm:BankCode ;
  rdfs:range xsd:boolean .

# Axiom: A bank code is valid if the cash card was issued by the bank.
[ a owl:Axiom ;
  owl:annotatedSource atm:BankCode ;
  owl:annotatedProperty atm:isValid ;
  owl:annotatedTarget true ;
  rdfs:comment "A bank code is valid if the cash card was issued by the bank." ;
  owl:imports ( [ a owl:Restriction ;
                   owl:onProperty atm:issuedBy ;
                   owl:someValuesFrom atm:Bank ] )
] .
